import React from "react";
import Todo from './Todo';
import './App.css';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      item : { id: 0, title: "Hello World 1", done: true},
      item2 : { id: 1, title: "Hello World 2", done: false}
    };
  }

  render(){
    <div className="App">
      <Todo item={this.state.item} />
      <Todo item2={this.state.item2} />
    </div>

  }
}

export default App;
